t;/ul&gt;\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://172.21.10.223:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 2 &lt;/li&gt;\n          &lt;li&gt; Threads: 48 &lt;/li&gt;\n          &lt;li&gt; Memory: 345.47 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nfrom dask_interface import Deisa\nfrom dask.distributed import performance_report, wait \nimport dask.array as da\nimport os\nimport time \n\n# Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\n# Initialize the Deisa \nDeisa = Deisa(scheduler_info, config_file)\n\n# Get client\nclient = Deisa.get_client()\n\n# Get data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n#or\n# Get data descriptor as a dict of Dask array\n#arrays = Deisa.get_dask_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][::2]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\n\n# Sign contract\n#arrays.validate_contract()\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n    t = time.perf_counter()\n    # Construct a lazy task graph \n    \n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n\n    #arrays.validate_contract()    \n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n    arrays.validate_contract()   \n    \n    # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it. \n    print(client.compute(s).result(), flush=True)    \n\n\n    \n# wait until computation is done\n#k = wait(s)\nprint(\"Done in \",time.perf_counter() -t,  flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1222","type":"LinearScale"},{"attributes":{"source":{"id":"1213"}},"id":"1398","type":"CDSView"},{"attributes":{"axis":{"id":"1193"},"coordinates":null,"group":null,"ticker":null},"id":"1196","type":"Grid"},{"attributes":{"line_alpha":0.2,"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"num_fds"}},"id":"1396","type":"Line"},{"attributes":{},"id":"1049","type":"BasicTicker"},{"attributes":{"children":[{"id":"1216"},{"id":"1249"},{"id":"1282"},{"id":"1368"}],"sizing_mode":"stretch_both"},"id":"1399","type":"Column"},{"attributes":{"axis_label":"Bytes / second","coordinates":null,"formatter":{"id":"1364"},"group":null,"major_label_policy":{"id":"1316"},"ticker":{"id":"1297"}},"id":"1296","type":"LinearAxis"},{"attributes":{"months":[0,4,8]},"id":"1469","type":"MonthsTicker"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{},"id":"1422","type":"DatetimeTickFormatter"},{"attributes":{"axis":{"id":"1048"},"coordinates":null,"group":null,"ticker":null,"visible":false},"id":"1051","type":"Grid"},{"attributes":{"source":{"id":"1181"}},"id":"1206","type":"CDSView"},{"attributes":{"below":[{"id":"1048"}],"center":[{"id":"1051"},{"id":"1055"}],"left":[{"id":"1052"}],"renderers":[{"id":"1070"}],"sizing_mode":"stretch_both","title":{"id":"1417"},"toolbar":{"id":"1061"},"x_range":{"id":"1040"},"x_scale":{"id":"1044"},"y_range":{"id":"1042"},"y_scale":{"id":"1046"}},"id":"1039","subtype":"Figure","type":"Plot"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Panel"},
